import {Typography} from '@material-ui/core'
import {Grid} from '@material-ui/core'
import {TextField} from '@material-ui/core'
import { makeStyles } from '@material-ui/styles'


const useStyles = makeStyles(theme=> ({
  paper: {
    position: 'absolute',
    top: 0,
  },
  textField : {
    margin: theme.spacing(1)
  }
}))


const profileInput = {
  profile: [
    {
      id: 1, name: 'name', value: '', type: 'text'
    },
    {
      id: 1, name: 'image', value: '', type: 'file'
    },
    {
      id: 1, name: 'resume', value: '', type: 'file'
    },
    {
      id: 1, name: 'description', value: '', type: 'text'
    }
  ],
  skills: [
    {
      name: '', value: '',
    }
  ]
  }


function Dialog({open, setClose}) {
  const classes = useStyles()

  return (
    <MuiDialog 
      open={true}
      onClose={()=>setClose(false)}
      classes = {{paper: classes.paper}}
    >
      <DialogTitle>
        <Typography
         align="right"
        >
          X
        </Typography>
      </DialogTitle>

      <DialogContent>
        <Grid container justify="center" >
          {
            profileIn
          }



          <Grid item xs={12} sm={6} >
            <TextField 
              // fullWidth
              size="small"
              variant="outlined"
              name="name"
              label="Name"
              type="file"
              hide
              className={classes.textField}
            />
          </Grid>






        </Grid>



      </DialogContent>

    </MuiDialog>
  )
}

export default Dialog
